import React, { Component } from 'react'

class PokemonDetails extends Component {
    get show() {
        return this.props.activeSection === "pokemon"
    }

    render() {
        if (this.show) {
            return (
                <div>
                    Détails du Pokémon
                </div>
            )
        }
        else
            return null
    }
}

export default PokemonDetails
